-- ----------------------------
-- Table structure for b_creditor_rights
-- ----------------------------
DROP TABLE IF EXISTS `b_creditor_rights`;
CREATE TABLE `b_creditor_rights`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `apply_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '借款申请编号',
  `into_source` int(11) DEFAULT NULL COMMENT '进件来源',
  `apply_product` int(11) DEFAULT NULL COMMENT '申请借款产品',
  `apply_money` double DEFAULT NULL COMMENT '申请借款金额',
  `apply_term` int(11) DEFAULT NULL COMMENT '申请借款期限（月）',
  `apply_purpose` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '申请借款目的',
  `borrower_realname` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '借款人真实姓名',
  `borrower_idcard` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '借款人身份证号',
  `borrower_sex` int(11) DEFAULT NULL COMMENT '借款人性别',
  `borrower_age` int(11) DEFAULT NULL COMMENT '借款人年龄',
  `borrower_education` int(11) DEFAULT NULL COMMENT '借款人学历',
  `borrower_marital` int(11) DEFAULT NULL COMMENT '借款人婚姻状况',
  `borrower_city` int(11) DEFAULT NULL COMMENT '借款人现所在城市',
  `borrower_present_address` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '借款人现住址',
  `borrower_bank_account` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '借款人银行账号',
  `borrower_open_bank` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '借款人银行账号开户行',
  `borrower_house_count` int(11) DEFAULT NULL COMMENT '借款人房产数',
  `borrower_car_count` int(11) DEFAULT NULL COMMENT '借款人车产数',
  `borrower_work` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '借款人工作',
  `borrower_company_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '借款人公司名称',
  `borrower_company_address` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '借款人公司地址',
  `borrower_work_year` int(11) DEFAULT NULL COMMENT '借款人工作年限',
  `borrower_month_salary` double DEFAULT NULL COMMENT '借款人月薪',
  `borrower_credit_report_certification` int(11) DEFAULT NULL COMMENT '借款人信用报告认证状态',
  `borrower_credit_report_certification_time` datetime(0) DEFAULT NULL COMMENT '借款人信用报告认证时间',
  `borrower_idcard_certification` int(11) DEFAULT NULL COMMENT '借款人身份公安认证',
  `borrower_idcard_certification_time` datetime(0) DEFAULT NULL COMMENT '借款人身份公安认证时间',
  `borrower_work_certification` int(11) DEFAULT NULL COMMENT '借款人工作认证',
  `borrower_work_certification_time` datetime(0) DEFAULT NULL COMMENT '借款人工作认证时间',
  `borrower_income_certification` int(11) DEFAULT NULL COMMENT '借款人收入认证',
  `borrower_income_certification_time` datetime(0) DEFAULT NULL COMMENT '借款人收入认证时间',
  `borrower_house_certification` int(11) DEFAULT NULL COMMENT '借款人房产认证',
  `borrower_house_certification_time` datetime(0) DEFAULT NULL COMMENT '借款人房产认证时间',
  `borrower_field_certification` int(11) DEFAULT NULL COMMENT '借款人实地认证',
  `borrower_field_certification_time` datetime(0) DEFAULT NULL COMMENT '借款人实地认证时间',
  `audit_status` int(11) DEFAULT NULL COMMENT '债权审批状态（待审批，审批通过，审批未通过）',
  `audit_time` datetime(0) DEFAULT NULL COMMENT '债权审批时间',
  `audit_loan_term` int(11) DEFAULT NULL COMMENT '债权审批借款期限（月）',
  `audit_loan_money` double DEFAULT NULL COMMENT '债权审批借款金额',
  `contract_loan_money` double DEFAULT NULL COMMENT '签订合同借款金额（加上服务费之后的金额）',
  `consulting_fee` double DEFAULT NULL COMMENT '咨询费',
  `audit_fee` double DEFAULT NULL COMMENT '审核费',
  `service_fee` double DEFAULT NULL COMMENT '服务费',
  `access_fee` double DEFAULT NULL COMMENT '外访服务费',
  `year_rate` double DEFAULT NULL COMMENT '借款年利率',
  `put_money` double DEFAULT NULL COMMENT '放款金额（合同金额减去服务费之后的金额）',
  `creditor_rights_type` int(11) DEFAULT NULL COMMENT '债权类型，0：自主债权，1:三方债权',
  `match_status` int(11) DEFAULT NULL COMMENT '债权匹配状态，0：等待匹配，1：匹配完成',
  `collect_status` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '募资状态，0：等待募集，1：募集完成',
  `collect_finish_time` datetime(0) DEFAULT NULL COMMENT '资金募集完成时间',
  `match_finish_time` datetime(0) DEFAULT NULL COMMENT '债权匹配完成时间',
  `loan_contract_path` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '债权借款合同URL地址',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 154 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

